import React, {useState, useEffect} from "react";

function App() {
    const [message, setMessage] = useState([]);
    useEffect(() => {
        fetch("api/test")
            .then((res) => {
                return res.json();
            })
            .then((data) => {
                setMessage(data);
            });
    }, []);
    return (
        <div>
            BackEnd Data: {message}
        </div>
    );
}

export default App;
